emsa　エムザ　保温ポット・保冷ポット　<br><style type="text/css"><!--.style2 {color:#ffffff;font-size:12px;}.style1 {color:#ffccff;font-size:12px;}--></style><center><div style="border:solid 8px; border-color:#C00; box-shadow:2px 2px 3px #999; width:740px;"><img src="http://image.rakuten.co.jp/kamekenken/cabinet/bnr/osusume/osusume-emsa.jpg" width="740" height="263" /></div><br /><br /><table width="600" border="0" cellspacing="0" cellpadding="0"><tr><td><h1>emsa　エムザ　保温・保冷ポット 1.5L</h1></td></tr><tr><td><div align="center"><br><img src="http://image.rakuten.co.jp/nihontuuhan/cabinet/shi-a/tsu1806_001.jpg"><br></div></td></tr><tr><td><br><br><table style="font-size:10pt;" width="590" border="0" cellspacing="5" cellpadding="0">      <tr>        <td><div align="center"><img src="http://www.rakuten.ne.jp/gold/matsucame/pic_data/tukattemita.jpg" border="0"></div></td>        </tr>      <tr>        <td align="center"><img src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/tsu1806-t001.jpg" border="0"><br><br><strong>エムザ emsa　保温・保冷ポット</strong><br>使っています。  <br><br><br>電気を使わない　保温保冷ポット<br>保温ポットというと、シルバーのものが一般的ですが、<br>エムザポットはカラフルなカラーが選べます。<br>インテリアに合わせて、お好きなカラーをチョイス(^^♪  <br><br></td>  </tr>      <tr><td><hr></td></tr>      <tr>        <td align="center"><img src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/tsu1806-t002.jpg" border="0"><br><br>お洒落な見た目だけでなく、保温性も抜群！<br><br>昼に沸かしたお湯をemsaのポットに入れて、<br>夕飯後にお茶を入れてみました。<br><br>まだ熱いまま！<br>驚きです。<br><br>これで毎回お茶のたびにお湯を沸かす手間が省けます。<br><br></td></tr><tr><td><hr></td></tr><tr>        <td align="center"><img src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/tsu1806-t003.jpg" border="0"><br><br>エムザ 保温保冷ポットの中（フラスコ）は<br>ニオイの付きにくいガラス製です。<br><br>電気不要の保温ポットなので、中まできれいに洗えます。  <br><br></td>  </tr><tr><td><hr></td></tr></table><p>&nbsp;</p></td></tr><tr><td><table style="font-size:11pt;" width="500" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><p>ヨーロッパ屈指のキッチンメーカー、ドイツｅｍｓａ社の卓上ポット。<br>ヨーロピアンデザインで食卓を彩ります。 <br>注ぎ口はワンプッシュ開閉で簡単・便利。<br />フラスコはにおいの付きにくいガラス製ですから、コーヒー等の美味しさや風味を保ちます。<br />機能性に加え、すっきり鮮やかなカラーのやさしいカーブのデザインは食卓に潤いを与えます。<br><br>■色：レッド、ホワイト、グリーン、イエロー、オレンジ、ブラック、パープル<br>■サイズ：直径17cm高さ26cm、容量1.5L<br>■本体…ABS樹脂、内側…ガラス<br>■保温効果目安…75℃以上（１０時間）　６０度以上（２４時間）<br>■ドイツ製<br>■内部はガラス製ですので落下したり角にぶつけたりすると割れる可能性があります。お取り扱いに注意ください。<br>■氷や炭酸水入れないでください。内部に傷をつけ割れに繋がる場合がございます。<br>■熱いお湯を入れた後すぐに冷水を入れるなどの急激な温度変化も割れに繋がりますので、しばらくして内側の温度が落ち着いてから注いでください。（特に熱湯消毒した後などはお気を付け下さい）<br><br>保温ポット　保冷ポット　おしゃれなデザイン</p></td></tr></table></td></tr><tr><td>&nbsp;</td></tr></table><table cellspacing="1" cellpadding="5" border="1" width="500" style="font-size:10pt;"><TR><TD bgColor="#FFCCFF" width="100">商品名</TD><TD width="500"><p>emsa　エムザ　保温・保冷ポット　1.5リットル</p></TD></TR><TR><TD bgColor="#ffccff" width="100">区分</TD><TD width="500">キッチン用品</TD></TR><TR><TD bgColor="#ffccff" width="100">広告文責</TD><TD width="500">株式会社マツムラカメラ　076-242-1122</TD></TR></table><br><table width="600" border="0" cellspacing="0" cellpadding="0"><tr><td><div align="center"><img src="http://image.rakuten.co.jp/esteyou/cabinet/img-2/pre2.gif"><br><br><img src="http://www.rakuten.ne.jp/gold/matsucame/pic_data/koshihikari.jpg"><br><br><br><font color="#ff0000" size="2">※おまけはお一人様につき１点となります</font><br></div></td></tr></table></center><br>　emsa　エムザ　保冷保温ポット　<br>送料　北海道・沖縄や離島は別途です。<br><br><a href="http://my.bookmark.rakuten.co.jp/?func=reg&amp;svid=101&amp;shop_bid=303413&amp;iid=10004568&amp;itype=1" target="_blank"><img src="http://image.rakuten.co.jp/nihonnett/cabinet/001/okiniiri-n.jpg" width="700" height="60" border="0"></a><br><br><div style="color:#666; font-size:10px; width:500px;">母の日 ギフト 父の日 ギフト 敬老の日 ギフト クリスマス ギフト お正月 子供の日 ギフト バレンタインデー ギフト ホワイトデー ギフト 可愛い おしゃれ オシャレ パーティー 入学祝い ギフト 卒業祝い ギフト 結婚記念日 ギフト お歳暮 ギフト お中元 旧正月 春節 お誕生日 などのプレゼントに<br><br><u>大変申し訳ございませんが のし 包装は対応いたしておりません。</u></div><center>
